import ReactDOM from 'react-dom'
import './index.css'
let greeting=''
let css={}
let date=new Date().getHours();
if(date>=1 && date<12){
    greeting='  good morning'
    css={color:'blue'}
}
else if(date>=12 && date<19){
    greeting=' good afternoon'
    css={color:'orange'}
}
else{
    greeting='good night'
    css={color:'black'}
}

ReactDOM.render(<>
    <h1>hello sirji</h1>

